import React from 'react';
import HomeCSS from '../../assets/css/Home.css';
import SignupCSS from '../../assets/css/Signup.css'
import { BrowserRouter, Route, Link } from "react-router-dom";
import { BsApple } from 'react-icons/bs';
import { BsXLg } from 'react-icons/bs';
import Home from './Home.jsx';
import bag from '../../assets/img/bag.png';
import banner from '../../assets/img/banner.png';
import headphone from '../../assets/img/headphone.png';
import watch3 from '../../assets/img/watch3.png';
import shoe from '../../assets/img/shoe.png';
import jacket2 from '../../assets/img/jacket2.png';
import trouser from '../../assets/img/trouser.png';
import watch2 from '../../assets/img/wath2.png';
import redshoe from '../../assets/img/redshoe.png';
import tshirt4 from '../../assets/img/tshirt4.png';
import tshirt3 from '../../assets/img/tshirt3.png';
import tshirt2 from '../../assets/img/tshirt2.png';
import tshirt1 from '../../assets/img/tshirt1.png';

function Signup() {
  return (
    <div>
        <menu>
            <div className="category">
                <p>
                    Shop by Category
                    <img src="" alt="" />
                </p>
            </div>
            <div className="sub-menu"> 
                <div className="menu-links">
                    <a href="/">Users</a>
                </div>
                <div className="menu-links">
                    <a href="/">Today's Deals</a>
                </div>
                <div className="menu-links">
                    <a href="/">A2Z Pay</a>
                </div>
                <div className="links">
                    <a href="/">Sell</a>
                </div>
                <div className="customer">
                    <a href="/">Customer Service</a>
                </div>
            </div>
        </menu>

        <div className="create-account-box">
            <div className="create-account">
                <Link className='exit' to='/'>
                    <BsXLg />
                </Link>
                <h1 className="create-account-title">Create an account and discover the benefits</h1>
                <p className="create-account-subtitle">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s</p>
                <form action="">
                    <div className="create-account-input-field">
                        <input className="create-account-input" type="text" placeholder="User Name" />
                        <input className="create-account-input" type="text" placeholder="Email" />
                        <input className="create-account-input" type="text" placeholder="Password" />
                    </div>
                    <div className="checkbox-field">
                        <input type="checkbox" />
                        <span className="create-account-checkbox">I agree to the Google Terms of Service and
                            Privacy Policy</span>
                    </div>
                    <button className="create-account-button">Sign Up</button>
                </form>

            </div>
            <div className="gray-box"></div>
        </div>

        <Home />


   </div>
  )
}

export default Signup
